import Nastavnici from './components/Nastavnici';
import { Routes, Route, Outlet, Link } from 'react-router-dom';

function App() {
  return (
    <div>
      <h1>Main Navigation</h1>

      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="nastavnci" element={<Nastavnicii />} />
          <Route path="predmeti" element={<Predmeti />} />

          {/* Using path="*"" means "match anything", so this route
                acts like a catch-all for URLs that we don't have explicit
                routes for. */}
          <Route path="*" element={<h1>Nema...</h1>} />
        </Route>
      </Routes>
    </div>
  );
}

function Layout() {
  return (
    <div>
      {/* A "layout route" is a good place to put markup you want to
          share across all the pages on your site, like navigation. */}
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/predmeti">Predmeti</Link>
          </li>
          <li>
            <Link to="/nastavnici">Nastavnici</Link>
          </li>
          <li>
            <Link to="/nothing-here">404 Greska Here</Link>
          </li>
        </ul>
      </nav>

      <hr />

      {/* An <Outlet> renders whatever child route is currently active,
          so you can think about this <Outlet> as a placeholder for
          the child routes we defined above. */}
      <Outlet />
    </div>
  );
}

function Home() {
  return <h1>Ovo je pocetna</h1>;
}

function Nastavnicii() {
  return <h1>Nastavnici</h1>;
}

function Predmeti() {
  return <h1>Predmeti</h1>;
}

export default App;
